package main

import (
	"encoding/json"
	"fmt"
)

type InputReq struct {
	Data []byte `protobuf:"bytes,1,opt,name=data,proto3" json:"data,omitempty"`
}


const (
	CMSID_STATE_INIT       = 1 // 加工中
	CMSID_STATE_DISTRIBUTE = 2 // 可分发
	CMSID_STATE_WITHDRAWN = 3  // 已撤回
	CMSID_STATE_DEL        = 4  // 已删除
)

const (
	RecoverStackSize = 64 << 10 // 64KB
)

type ArticleInput struct {
	AdminQq                         *int        `json:"AdminQq,omitempty"`                            // 管理员QQ 管理员的QQ号用于账号打通
	ArticleType                     *int32      `json:"ArticleType,omitempty"`                        // 文章内容类型 0：普通文章，1：组图文章
	Category1                       string      `json:"Category1,omitempty"`                          // 一级分类
	Category2                       string      `json:"Category2,omitempty"`                          // 二级分类
	Categoryid1                     *int32      `json:"Categoryid1,omitempty"`                        // 一级分类id
	Categoryid2                     *int32      `json:"Categoryid2,omitempty"`                        // 二级分类id
	Cmsid                           string      `json:"Cmsid,omitempty"`                              // 文章ID 文章唯一标示
	ColumnName                      string      `json:"ColumnName,omitempty"`                         // 栏目名 栏目名/类似专题，OM发文时带过来（腾讯网新闻网专有）
	Content                         string      `json:"Content,omitempty"`                             // 正文内容(json格式) 原始内容信息包含图片文本商品、音乐、外链等（不带导语结语）
	ContentWithNovel                string      `json:"ContentWithNovel,omitempty"`                   // 正文html 支持小说（只给看点）
	EXT_business_cash_flag          *int32      `json:"EXT.business_cash_flag,omitempty"`             // 是否商业化文章标识
}

